window.bookSummaryJSON = "<p>CONTAINS BONUS MATERIAL!</p> <p>Find out what happens after the epilogue. Matthias and Mack: one needs to face their traumatic past while the other needs to overcome their mistakes.</p> <p>Wes and Emily: one needs to clear his name while the other needs to find a place to belong.</p> <p>Austin and Mariah: one needs to battle their addiction while the other needs to lower their walls. Shane and Bella: one needs to know their worth while the other needs to escape their reality.</p> <p>Hux and Cassie: one needs to finally take life seriously while the other needs to leave theirs behind.</p> <p>Clyde and Lena: one needs to learn to forgive themselves while the other needs to face their fears.</p> <p>This box set contains all their trials and tribulations as they find their fated mates. Join the Southern Werewolf Enforcers as they fight to defend their packs and the women they love. Ever wonder what happens after \"The End\"? Hear exclusive bonus content about each couple you can only find here!</p> <p>This book contains sexual themes and violence that is intended for audiences 18 and older.</p>"; 
